import fitz
import sys
import json
import os
import base64
import webbrowser
import shutil
from PyQt6.QtWidgets import QApplication, QWidget, QLabel, QPushButton, QVBoxLayout, QHBoxLayout, QFrame
from PyQt6.QtGui import QShortcut, QKeySequence, QPixmap, QMouseEvent, QBrush, QPalette
from PyQt6.QtCore import Qt, QPoint

class ImageWidget(QFrame):
    def __init__(self, parent, path, image_size, image_pos):
        super().__init__(parent)
        self.path = path
        self.image_size = image_size
        self.image_pos = image_pos
        self.grip_size = 10
        self.setMinimumWidth(30)
        self.setMinimumHeight(30)
        self.setMouseTracking(True)
        self.resizing = False
        self.setStyleSheet("background-color: white;")
        self.layout = QVBoxLayout(self)
        self.layout.setContentsMargins(0, 0, 0, 0)

        self.navbar = QWidget(self)
        self.navbar.setFixedHeight(20)
        self.navbar_layout = QHBoxLayout(self.navbar)
        self.navbar_layout.setContentsMargins(0, 0, 0, 0)
        self.layout.addWidget(self.navbar)

        self.filename_label = QLabel(os.path.basename(path), self.navbar)
        self.navbar_layout.addWidget(self.filename_label)

        self.delete_button = QPushButton("×", self.navbar)
        self.delete_button.setFixedSize(20, 20)
        self.delete_button.clicked.connect(self.delete)
        self.navbar_layout.addWidget(self.delete_button)
        self.navbar_layout.setContentsMargins(0, 0, 0, 0)

        self.image_label = QLabel(self)
        self.layout.addWidget(self.image_label)

        self.pixmap = QPixmap()  # pixmapをインスタンス変数として定義
        with open(path, "rb") as f:
            #もしパスがPDFならfitzで画像を作成
            if path.endswith(".pdf"):
                pdf = fitz.open(path)
                page = pdf.load_page(0)
                pixmap = page.get_pixmap()
                self.pixmap = pixmap
            else:
                self.pixmap.loadFromData(f.read())
        self.resize(*image_size) 
        if not self.pixmap.isNull():
            self.image_size = self.scale_to_max_size(self.pixmap.size(), 400)  # 最大サイズにスケーリング
            self.update_image_size()
        self.move(*image_pos)

        self.drag_start_pos = None
        self.aspect_ratio = self.pixmap.width() / self.pixmap.height() if not self.pixmap.isNull() else 1
        image_width = image_size[0]
        image_height = int(image_width / self.aspect_ratio) + 20
        self.resize(image_width, image_height)
        
    def scale_to_max_size(self, original_size, max_size):
        width, height = original_size.width(), original_size.height()
        if width > height:
            if width > max_size:
                height = int(height * (max_size / width))
                width = max_size
        else:
            if height > max_size:
                width = int(width * (max_size / height))
                height = max_size
        return [width, height]

    def update_image_size(self):
        if not self.pixmap.isNull():
            scaled_size = self.pixmap.size().scaled(self.size(), Qt.AspectRatioMode.KeepAspectRatio)
            self.image_label.setPixmap(self.pixmap.scaled(scaled_size, Qt.AspectRatioMode.KeepAspectRatio))
            self.image_label.setFixedSize(scaled_size)

    def mousePressEvent(self, event: QMouseEvent):
        if event.button() == Qt.MouseButton.LeftButton:
            if self.is_in_grip_area(event.pos()):
                self.resizing = True
                self.old_pos = event.pos()
            else:
                self.drag_start_pos = event.pos()

    def mouseMoveEvent(self, event: QMouseEvent):
        if self.resizing:
            delta = event.pos() - self.old_pos
            new_width = self.width() + delta.x()
            new_height = int(new_width / self.aspect_ratio) + 20
            self.resize(new_width, new_height)
            self.image_size = [new_width, new_height]
            self.old_pos = event.pos()
            self.update_image_size()
        elif self.drag_start_pos:
            self.move(self.pos() + event.pos() - self.drag_start_pos)

    def mouseReleaseEvent(self, event: QMouseEvent):
        self.drag_start_pos = None
        self.resizing = False
        self.image_size = [self.width(), self.height()]
        self.parent().save_settings() 

    def mouseDoubleClickEvent(self, event: QMouseEvent):
        if event.button() == Qt.MouseButton.LeftButton:
            webbrowser.open(f'file://{os.path.abspath(self.path)}')

    def delete(self):
        try:
            os.remove(self.path)
        except OSError as e:
            print(f"Error deleting file {self.path}: {e}")
        self.parent().delete_image(self)

    def is_in_grip_area(self, pos: QPoint):
        grip_size = self.grip_size
        width, height = self.width(), self.height()
        x, y = pos.x(), pos.y()
        return (
            (0 <= x <= grip_size and 0 <= y <= grip_size) or
            (width - grip_size <= x <= width and 0 <= y <= grip_size) or
            (0 <= x <= grip_size and height - grip_size <= y <= height) or
            (width - grip_size <= x <= width and height - grip_size <= y <= height)
        )

class FullScreenApp(QWidget):
    def __init__(self):
        super().__init__()
        self.settings_file = "settings.json"
        self.image_folder = self.get_image_folder()
        self.image_widgets = []
        self.init_ui()

        # ドラッグ＆ドロップの設定
        self.setAcceptDrops(True)


    def get_image_folder(self):
        folder_name = "NoticeBoardImages"
        desktop_path = os.path.join(os.path.join(os.environ['USERPROFILE']), 'Desktop')
        folder_path = os.path.join(desktop_path, folder_name)
        
        if not os.path.exists(folder_path):
            os.makedirs(folder_path)
            
            # アイコン画像を保存
            icon_path = os.path.join(folder_path, "folder_icon.ico")
            with open(icon_path, "wb") as icon_file:
                icon_file.write(base64.b64decode(b""))  # YOUR_ICON_BASE64はアイコン画像のBase64エンコード文字列

            desktop_ini_path = os.path.join(folder_path, "desktop.ini")
            with open(desktop_ini_path, "w") as desktop_ini_file:
                desktop_ini_file.write(f"""
[.ShellClassInfo]
IconResource={icon_path},0
""")
            os.system(f'attrib +h "{desktop_ini_path}"')
            os.system(f'attrib +s "{folder_path}"')
            os.system(f'attrib +h "{icon_path}"')  # アイコン画像を隠しファイルに設定
        
        return folder_path

    def init_ui(self):
        self.setWindowTitle("掲示板")
        self.showFullScreen()
        self.esc_shortcut = QShortcut(QKeySequence(Qt.Key.Key_Escape), self)
        self.esc_shortcut.activated.connect(self.close)
        self.load_settings()
        # 背景画像の設定
        self.set_background_image("コルクボード.jpg")

    def set_background_image(self, image_path):
        pixmap = QPixmap(image_path)
        palette = QPalette()
        palette.setBrush(QPalette.ColorRole.Window, QBrush(pixmap))
        self.setPalette(palette)

    def dragEnterEvent(self, event):
        if event.mimeData().hasUrls():
            event.acceptProposedAction()

    def dropEvent(self, event):
        for url in event.mimeData().urls():
            file_path = url.toLocalFile()
            if os.path.isfile(file_path):
                shutil.copy(file_path, self.image_folder)
                self.add_image(file_path)

    def add_image(self, path):
        image_widget = ImageWidget(
            self,
            path=os.path.join(self.image_folder, os.path.basename(path)),
            image_size=[400, 400],
            image_pos=[0, 0]
        )
        self.image_widgets.append(image_widget)
        image_widget.show()
        self.save_settings()

    def delete_image(self, image_widget):
        self.image_widgets.remove(image_widget)
        image_widget.deleteLater()
        self.save_settings()

    def save_settings(self):
        settings = [
            {
                "path": widget.path,
                "image_size": widget.image_size,
                "image_pos": [widget.x(), widget.y()]
            }
            for widget in self.image_widgets
        ]
        with open(self.settings_file, "w") as f:
            json.dump(settings, f, indent=4)
            
    def load_settings(self):
        if os.path.exists(self.settings_file):
            with open(self.settings_file, "r") as f:
                try:
                    settings = json.load(f)
                except json.JSONDecodeError:
                    settings = []
                    
        file_names = [filename for filename in os.listdir(self.image_folder)]
        file_names = [filename for filename in file_names if filename.endswith((".png", ".jpg", ".jpeg", ".bmp", ".gif", ".tiff", ".pdf"))]
        
        if settings:
            for image_setting in settings:
                image_file_name = os.path.basename(image_setting["path"])
                if not image_file_name in file_names:
                    settings.remove(image_setting)
                    continue
                image_widget = ImageWidget(self, **image_setting)
                self.image_widgets.append(image_widget)
                image_widget.show()
            
        existing_paths = [image_widget.path for image_widget in self.image_widgets]
        for filename in file_names:
            path = os.path.join(self.image_folder, filename)
            if path not in existing_paths:
                image_widget = ImageWidget(
                    self,
                    path=path,
                    image_size=[400, 400],
                    image_pos=[0, 0]
                )
                self.image_widgets.append(image_widget)
                image_widget.show()
                self.save_settings()

if __name__ == "__main__":
    app = QApplication(sys.argv)
    window = FullScreenApp()
    window.show()
    sys.exit(app.exec())
